import React, { useState } from 'react'
import { TouchableOpacity } from 'react-native-gesture-handler'

function Button (props) {

    return (
        <TouchableOpacity onClick={props.onClick}>
            <Text>{props.text}</Text>
        </TouchableOpacity>
    )
}

export default Button
